import React from 'react';
import "./Resume.css";

function Resume() {
    return (
        <div className="ResumeDiv">
            <h1 className="ResumeDiv">Sugene's Resume</h1>
            <h3 className="ResumeDiv">Languages and Technologies</h3>
            <div className="ResumeDiv">
                <strong>Languages: </strong><ul><li>HTML5</li><li>CSS3</li><li>PHP</li><li>JavaScript</li><li>SQL</li><li>AMPScript</li><li>RPL</li><li>React</li><li>Angular</li><li>TypeScript</li><li>Node.js</li><li>Express</li><li>Heroku</li><li>Python</li><li>Selenium</li></ul>
            </div>
            <div className="ResumeDiv">
                <strong>Technologies: </strong>Salesforce Marketing Cloud, Pardot, Oracle Responsys, Emarsys, Visual Studio, Litmus, Email On Acid, Wordpress, Canva, Adobe Photoshop, Adobe InDesign, Microsoft Office Suite
            </div>
        </div>
    )
}

export default Resume;
